Title: Determine when to send email/text
Acceptance Test: damoSendMessage
Priority: 3
Story Points: 2
Given the location and schedule of Professor Damopoulos from groups 1 and 2
When Professor Damopoulos is late for a meeting/class/event. 
Then an email will be sent to companion/partner/business associate stating that Damopoulos will be running late to a meeting or appointment.
</text>

So that I can be complemented or consoled in relevant ways
